import React from "react";

function App() {

  const [firstName, fmethod] = React.useState()
  const [lastName, lmethod ] = React.useState()

  function frstName(event){
    return fmethod(event.target.value)
  }

  function lstName(event){
    return lmethod(event.target.value)
  }

  return (
    <div className="container">
      <h1>Hello {firstName} {lastName}</h1>
      <form>
        <input onChange={frstName} name="fName" placeholder="First Name" />
        <input onChange={lstName} name="lName" placeholder="Last Name" />
        <button>Submit</button>
      </form>
    </div>
  );
}

export default App;
